  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is a georeferenced version
  of an original black and white aerial photograph downloaded from Earth Explorer
  (USGS). The original photo was georeferenced against the Linn County 2012 NAIP images.
  This data set provides a look back in time at land conditions along a stretch of
  the Marias des Cygnes River which is now part of the refuge. This image (at a resolution
  of 5-meters) allows a general look at habitats including which areas were cropped,
  native prairie, and woodlands at that time. Change over time estimates can be made
  from this image using current imagery for comparison. This image, and others from
  1938 and the 1950s, is being used by refuge staff to assist in understanding and
  visualizing the historical content of the lands within the refuge and how they have
  changed over the last 50 years. Pixel resolution of this image is  5.0 meters. This
  image should be used for resource-level interpretation only.\",\n\t\"owner_org\":
